// Range helper -------------------------------------------------------------------------------
function makeArray (firstNumber, secondNumber) {
  let rangeArray = [];
  for (let i = firstNumber; i <= secondNumber; i++) {
      rangeArray.push(i);
  }   
  return rangeArray;
}

function makeReverseArray(firstNumber, secondNumber) {
  let rangeArray = [];
  for (let i = firstNumber; i >= secondNumber; i--) {
      rangeArray.push(i);
  }
  return rangeArray;
}

